import React from "react";

function MainContent() {
  return (
    <main>
      <ul>
        <li>Pinterest Healthy Dinner Recipes</li>
        <input type="checkbox" />
        <li>Study React</li>
        <input type="checkbox" />
        <li>Plan outfit for tomorrow</li>
        <input type="checkbox" />
        <li>Catch up on The Bachelorette</li>
        <input type="checkbox" />
      </ul>
    </main>
  );
}

export default MainContent;
